import React from 'react';
import ReactDOM from 'react-dom';
import Sdata from './Sdata';
import './index.css';
import Card from './Cards';

 ReactDOM.render(
    <>
    <h1 className='heading_style'>List Of Top 5 Netflix Series</h1>
    {Sdata.map((val, index) =>{
        console.log(index);
        return(
            <Card
            key={val.id}
            imgsrc={val.imgsrc}
            tiltle={val.title}
            sname={val.sname}
            link={val.links}

            />
        );
    })}
    </>,
    document.getElementById("root")
 );
